                    g_xxxxxxxx_0[k] = pbx * g10_xxxxxxx_0[k] + fr * g11_xxxxxxx_0[k] + f2g * (7.0 * g20_xxxxxx_0[k] - 7.0 * fgz * g21_xxxxxx_0[k]);

