                    g_xxyyyzzz_0[k] = pbx * g10_xyyyzzz_0[k] + fr * g11_xyyyzzz_0[k] + f2g * (g20_yyyzzz_0[k] - fgz * g21_yyyzzz_0[k]);

                    g_xxyyzzzz_0[k] = pbx * g10_xyyzzzz_0[k] + fr * g11_xyyzzzz_0[k] + f2g * (g20_yyzzzz_0[k] - fgz * g21_yyzzzz_0[k]);

                    g_xxyzzzzz_0[k] = pbx * g10_xyzzzzz_0[k] + fr * g11_xyzzzzz_0[k] + f2g * (g20_yzzzzz_0[k] - fgz * g21_yzzzzz_0[k]);

                    g_xxzzzzzz_0[k] = pbx * g10_xzzzzzz_0[k] + fr * g11_xzzzzzz_0[k] + f2g * (g20_zzzzzz_0[k] - fgz * g21_zzzzzz_0[k]);

                    g_xyyyyyyy_0[k] = pbx * g10_yyyyyyy_0[k] + fr * g11_yyyyyyy_0[k];

                    g_xyyyyyyz_0[k] = pbx * g10_yyyyyyz_0[k] + fr * g11_yyyyyyz_0[k];

                    g_xyyyyyzz_0[k] = pbx * g10_yyyyyzz_0[k] + fr * g11_yyyyyzz_0[k];

                    g_xyyyyzzz_0[k] = pbx * g10_yyyyzzz_0[k] + fr * g11_yyyyzzz_0[k];

                    g_xyyyzzzz_0[k] = pbx * g10_yyyzzzz_0[k] + fr * g11_yyyzzzz_0[k];

                    g_xyyzzzzz_0[k] = pbx * g10_yyzzzzz_0[k] + fr * g11_yyzzzzz_0[k];

                    g_xyzzzzzz_0[k] = pbx * g10_yzzzzzz_0[k] + fr * g11_yzzzzzz_0[k];

                    g_xzzzzzzz_0[k] = pbx * g10_zzzzzzz_0[k] + fr * g11_zzzzzzz_0[k];

