                    g_z_xxyzzzzz[k] = pbz * g10_0_xxyzzzzz[k] + fr * g11_0_xxyzzzzz[k] + 5.0 * f2t * gk_0_xxyzzzz[k];

                    g_z_xxzzzzzz[k] = pbz * g10_0_xxzzzzzz[k] + fr * g11_0_xxzzzzzz[k] + 6.0 * f2t * gk_0_xxzzzzz[k];

                    g_z_xyyyyyyy[k] = pbz * g10_0_xyyyyyyy[k] + fr * g11_0_xyyyyyyy[k];

                    g_z_xyyyyyyz[k] = pbz * g10_0_xyyyyyyz[k] + fr * g11_0_xyyyyyyz[k] + f2t * gk_0_xyyyyyy[k];

                    g_z_xyyyyyzz[k] = pbz * g10_0_xyyyyyzz[k] + fr * g11_0_xyyyyyzz[k] + 2.0 * f2t * gk_0_xyyyyyz[k];

                    g_z_xyyyyzzz[k] = pbz * g10_0_xyyyyzzz[k] + fr * g11_0_xyyyyzzz[k] + 3.0 * f2t * gk_0_xyyyyzz[k];

                    g_z_xyyyzzzz[k] = pbz * g10_0_xyyyzzzz[k] + fr * g11_0_xyyyzzzz[k] + 4.0 * f2t * gk_0_xyyyzzz[k];

                    g_z_xyyzzzzz[k] = pbz * g10_0_xyyzzzzz[k] + fr * g11_0_xyyzzzzz[k] + 5.0 * f2t * gk_0_xyyzzzz[k];

                    g_z_xyzzzzzz[k] = pbz * g10_0_xyzzzzzz[k] + fr * g11_0_xyzzzzzz[k] + 6.0 * f2t * gk_0_xyzzzzz[k];

                    g_z_xzzzzzzz[k] = pbz * g10_0_xzzzzzzz[k] + fr * g11_0_xzzzzzzz[k] + 7.0 * f2t * gk_0_xzzzzzz[k];

                    g_z_yyyyyyyy[k] = pbz * g10_0_yyyyyyyy[k] + fr * g11_0_yyyyyyyy[k];

                    g_z_yyyyyyyz[k] = pbz * g10_0_yyyyyyyz[k] + fr * g11_0_yyyyyyyz[k] + f2t * gk_0_yyyyyyy[k];

                    g_z_yyyyyyzz[k] = pbz * g10_0_yyyyyyzz[k] + fr * g11_0_yyyyyyzz[k] + 2.0 * f2t * gk_0_yyyyyyz[k];

                    g_z_yyyyyzzz[k] = pbz * g10_0_yyyyyzzz[k] + fr * g11_0_yyyyyzzz[k] + 3.0 * f2t * gk_0_yyyyyzz[k];

                    g_z_yyyyzzzz[k] = pbz * g10_0_yyyyzzzz[k] + fr * g11_0_yyyyzzzz[k] + 4.0 * f2t * gk_0_yyyyzzz[k];

                    g_z_yyyzzzzz[k] = pbz * g10_0_yyyzzzzz[k] + fr * g11_0_yyyzzzzz[k] + 5.0 * f2t * gk_0_yyyzzzz[k];

