                    g_yyyyyyyy_yy[k] = pby * g10_yyyyyyy_yy[k] + fr * g11_yyyyyyy_yy[k] + f2g * (7.0 * g20_yyyyyy_yy[k] - 7.0 * fgz * g21_yyyyyy_yy[k]) + 2.0 * f2t * gk_yyyyyyy_y[k];

