                    g_yyyzzzzz_yz[k] = pby * g10_yyzzzzz_yz[k] + fr * g11_yyzzzzz_yz[k] + f2g * (2.0 * g20_yzzzzz_yz[k] - 2.0 * fgz * g21_yzzzzz_yz[k]) + f2t * gk_yyzzzzz_z[k];

                    g_yyyzzzzz_zz[k] = pby * g10_yyzzzzz_zz[k] + fr * g11_yyzzzzz_zz[k] + f2g * (2.0 * g20_yzzzzz_zz[k] - 2.0 * fgz * g21_yzzzzz_zz[k]);

                    g_yyzzzzzz_xx[k] = pby * g10_yzzzzzz_xx[k] + fr * g11_yzzzzzz_xx[k] + f2g * (g20_zzzzzz_xx[k] - fgz * g21_zzzzzz_xx[k]);

                    g_yyzzzzzz_xy[k] = pby * g10_yzzzzzz_xy[k] + fr * g11_yzzzzzz_xy[k] + f2g * (g20_zzzzzz_xy[k] - fgz * g21_zzzzzz_xy[k]) + f2t * gk_yzzzzzz_x[k];

                    g_yyzzzzzz_xz[k] = pby * g10_yzzzzzz_xz[k] + fr * g11_yzzzzzz_xz[k] + f2g * (g20_zzzzzz_xz[k] - fgz * g21_zzzzzz_xz[k]);

                    g_yyzzzzzz_yy[k] = pby * g10_yzzzzzz_yy[k] + fr * g11_yzzzzzz_yy[k] + f2g * (g20_zzzzzz_yy[k] - fgz * g21_zzzzzz_yy[k]) + 2.0 * f2t * gk_yzzzzzz_y[k];

                    g_yyzzzzzz_yz[k] = pby * g10_yzzzzzz_yz[k] + fr * g11_yzzzzzz_yz[k] + f2g * (g20_zzzzzz_yz[k] - fgz * g21_zzzzzz_yz[k]) + f2t * gk_yzzzzzz_z[k];

                    g_yyzzzzzz_zz[k] = pby * g10_yzzzzzz_zz[k] + fr * g11_yzzzzzz_zz[k] + f2g * (g20_zzzzzz_zz[k] - fgz * g21_zzzzzz_zz[k]);

                    g_yzzzzzzz_xx[k] = pby * g10_zzzzzzz_xx[k] + fr * g11_zzzzzzz_xx[k];

