                    g_zzzzzzzz_xx[k] = pbz * g10_zzzzzzz_xx[k] + fr * g11_zzzzzzz_xx[k] + f2g * (7.0 * g20_zzzzzz_xx[k] - 7.0 * fgz * g21_zzzzzz_xx[k]);

                    g_zzzzzzzz_xy[k] = pbz * g10_zzzzzzz_xy[k] + fr * g11_zzzzzzz_xy[k] + f2g * (7.0 * g20_zzzzzz_xy[k] - 7.0 * fgz * g21_zzzzzz_xy[k]);

